function Date(props){
    const month=props.date.toLocaleString('en-US',{month:'long'});
    const date=props.date.toLocalString('en-US',{day:'2-digit'});
    const year=props.date.getFullYear(); 
    return(
        <div>
            <div>{month}</div>
            <div>{date}</div>
            <div>{year}</div>
        </div>
    );
}

export default Date;
